gssumme. Der genannte Betrag ist nach § 4 Abs. 11 UStG umsatzsteuerfrei.</div></br>(2) Der genannte Betrag ist wie folgt zu zahlen:\r\n\r\n\r\n<div id=\"partial_payment_with_increased_starting_produkt\">\r\n<p> - Teilzahlung mit erhöhter Startzahlung</p>\r\n<p>Die Zahlung des Betrages wird dem Mandanten zinsfrei gestundet. Der Mandant leistet auf den in II. genannten Betrag eine Einmalzahlung in Höhe von <strong><span>100</span></strong> EUR. Der verbliebene Betrag in Höhe von <strong><span id=\"percentage_payment_produkt_content_value\">XXX</span></strong> EUR wird in <strong><span>444</span></strong> gleichen, monatlichen Raten zu jeweils <strong><span>100</span></strong> EUR, beginnend ab dem <strong><span>17-01-2020</span></strong>, gezahlt.</p>\r\n<p>Die Teil- bzw. Ratenzahlung stellt eine teilweise Stundung des jeweils noch ausstehenden Vergütungsbetrages aus dieser Vereinbarung. Bis zur nächsten Ratenfälligkeit wird der noch ausstehende Zahlbetrag gestundet. Eine Darlehensgewährung nach §§ 491 ff. BGB an den Mandanten ist damit ausdrücklich nicht verbunden.</p>\r\n<p>Raten- bzw. Teilzahlungszuschläge werden nicht erhoben. Der effektive Jahreszins beträgt 0,00%, der zu leistende Gesamtbetrag entspricht in Summe dem unter II. genannten Betrag.</p>\r\n<p>Kommt der Mandant mit zwei aufeinanderfolgenden Zahlungen oder mit einer Gesamtsumme, die betragsmäßig der Summe zweier Raten entspricht, in Verzug, ist der sodann noch ausstehende Gesamtbetrag sofort zur Zahlung fällig.</p>\r\nDer genannte Betrag ist fällig mit der erfolgreichen Vermittlung des unter I. genannten Produkts. Die Vermittlung gilt als erfolgreich, wenn der Produktanbieter den Antrag des Mandanten angenommen hat, spätestens aber mit Entgegennahme der ersten Zahlung auf den vermittelten Vertrag und des Ablaufs eines gesetzlichen Widerrufs- bzw. Rücktrittsrechts, auf welches der Mandant vom Produktanbieter gesondert hingewiesen wird.\r\n</div>\r\n<p><br><strong xss=\"removed\">3. Vertragsabwicklung</strong></p></br>\r\n(1) Für die Abwicklung dieses Vertrages nutzen die Parteien „dipay“, eine Onlineplattform zur Verwaltung und Abwicklung von Vergütungsvereinbarungen für Makler.<br><br>(2) Der Makler stellt dem Mandanten einen Zugang zur Plattform zur Verfügung. Dem Mandanten werden im Rahmen des Registrierungsvorgangs die Nutzungsbedingungen der Plattform zugänglich gemacht.<br>\r\n<p><strong><br></strong><strong xss=\"removed\">4. Zahlungsabwicklung</strong></p></br>\r\n(1) Die Zahlung der vom Mandanten und Makler vereinbarten Vergütung erfolgt über die vom Mandanten gewählte Zahlungsart. Dem Mandanten stehen folgende Zahlungsarten zur Verfügung:\r\n<div id=\"bank_produkt\">\r\n<p> - Überweisung</p>\r\n<p>(die nachfolgenden Punkte sind nur bei Überweisung erforderlich)</p></br>\r\n(2) Der Mandant zahlt den vereinbarten Betrag nach Abschluss des Vertrages und Rechnungstellung innerhalb von 14 Tagen auf das Konto des Maklers.<br><br>(3) Wird der Betrag nicht innerhalb der genannten Frist gezahlt, kommt der Mandant mit seiner Leistung in Verzug. Sofern die Leistungspflicht nach dem Kalender bestimmt ist, bedarf es keiner Mahnung des Maklers. Im Falle des Verzugs gelten die gesetzlichen Regelungen zum Schuldnerverzug.<br><br>(4) Der Makler ist berechtigt, bis zum vollständigen und vorbehaltslosen Ausgleich etwaiger offener Forderungen alle Leistungen aus diesem Vertrag einzustellen.<br>\r\n<p> </p>\r\n</div>\r\n\r\n<p><br><strong xss=\"removed\">5. Absicherung der Ansprüche des Maklers</strong></p></br>\r\n(1) Zur Sicherung der Zahlungsansprüche des Maklers aus dieser Vereinbarung tritt der Mandant seine Ansprüche aus dem unter Ziffer I genannten Vertrag an den Makler ab. Die Abtretung ist betragsmäßig auf Ansprüche des Maklers aus dieser Vereinbarung beschränkt.<br><br>(2) Der Makler nimmt die Abtretung an. Der Makler ist berechtigt, die Abtretung gegenüber dem Produktanbieter offenzulegen. Der Mandant soll über die Offenlegung der Abtretung in Textform informiert werden.<br><br>(3) Mit vollständiger Erfüllung der Zahlungspflichten des Mandanten aus diesem Vertrag endet, entfällt der Sicherungszweck und die Abtretung erlischt. Einer gesonderten Vereinbarung bedarf es sodann nicht mehr.<br>\r\n<p><strong> </strong></p>\r\n<p><strong>6. Schlussbestimmungen</strong></p></br>\r\n(1) Sämtliche Ansprüche des Mandanten gegen den Makler aus diesem Vertrag können ohne schriftliche Zustimmung des Maklers nicht an Dritte abgetreten oder übertragen werden.<br><br>(2) Eine Aufrechnung gegen Ansprüche aus diesem Vertrag ist ausgeschlossen, soweit die Ansprüche bestritten bzw. nicht rechtskräftig festgestellt sind.<br><br>(3) Soweit der Mandant Kaufmann ist, ist ausschließlicher Gerichtsstand für Auseinandersetzungen im Zusammenhang mit diesem Vertrag der Geschäftssitz des Maklers.<br><br>(4) Nebenabreden zu diesem Vertrag sind nicht getroffen. Alle Änderungen bedürfen zu ihrer Wirksamkeit der Schriftform. Gleiches gilt für die Aufhebung des Schriftformerfordernisses.<br><br>(5) Sollten eine oder mehrere Bestimmungen dieses Vertrages unwirksam sein oder werden, bleibt die Wirksamkeit der übrigen Bestimmungen unberührt.<br>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p><u>                                                                     </u>                   <u>                                                         </u></p>\r\n<p>Ort, Datum      Unterschrift Mandant                              Ort, Datum      Unterschrift Makler </p>', 0, 0, '028bba9ffdbc80ad9fb380ccd57e069a')
